import React from 'react';
import './../../assets/css/MiCuenta.css'
import 'bootstrap/dist/css/bootstrap.min.css';

export default function HistorialMedico(props) {
    const fecha = props.historialInfo.fecha;
    return(
        <div className="container-fluid">
            <div className="row historia">
                <div className="col">
                    <div className="row historiaInfo align-items-center">
                        <div className="col">
                            <span>{fecha}</span>
                        </div>
                    </div>
                    <div className="row historiaBody align-items-center">
                        <div className="col">

                        </div>
                    </div>
                </div>
            </div>

        </div>
    );
}
